window.bookSummaryJSON = "<p><b>It’s time to descend.</b> </p> <p>With Garralosh defeated and the Colony secured, Anthony has triumphed over the wave. What now for our intrepid adventurer? In the Dungeon, there’s only one place to go: down. </p> <p>Join Anthony as he ventures into the second stratum, the Shadow Sea, and finds far more than he bargained for. Bizarre monsters abound, frightening poisons and civilizations that have fought and lived in the depths for thousands of years. </p> <p>For the Colony!</p> <p><b>Book 4 of the hit monster-evolution LitRPG series with nearly 30 million views on Royal Road. Grab your copy today!</b></p> <p><b>About this Series: </b>Jump into a rebirth story that mixes LitRPG and GameLit elements with monster-evolution. Levels, Stats, Skills, Magic, Power Progression, Kingdom Building, Party Building, Army Building, evolution, a monster MC, gigantic enemies (compared to an Ant, at least), and plenty of humor fitting such an ludicrous premise.</p>"; 
